import React from 'react';
import ReactDOM from 'react-dom';

function tick() {
    const element = (
        <div>
            <h4>It is {new Date().toLocaleTimeString()}</h4>
        </div>
    );
    ReactDOM.render(element, document.getElementById('clock'));
}

setInterval(tick,1000)
